package com.nmims.app.Models;public class MyDate{    public String getDateId() {        return dateId;    }    public void setDateId(String dateId) {        this.dateId = dateId;    }    private String dateId;    private String currentDate;    private String startDate;    private String endDate;    public MyDate() {    }    public MyDate(String currentDate, String startDate, String endDate) {        this.currentDate = currentDate;        this.startDate = startDate;        this.endDate = endDate;    }    public MyDate(String startDate) {        this.startDate = startDate;    }    public MyDate(String endDate, String dateId)    {        this.endDate = endDate;        this.dateId = dateId;    }    public MyDate(String dateId, String currentDate, String startDate, String endDate) {        this.dateId = dateId;        this.currentDate = currentDate;        this.startDate = startDate;        this.endDate = endDate;    }    public String getCurrentDate() {        return currentDate;    }    public void setCurrentDate(String currentDate) {        this.currentDate = currentDate;    }    public String getStartDate() {        return startDate;    }    public void setStartDate(String startDate) {        this.startDate = startDate;    }    public String getEndDate() {        return endDate;    }    public void setEndDate(String endDate) {        this.endDate = endDate;    }}